content:
Esses Juízes acho que não conhecem a constituição. Eles criticam mas não se baseiam em nada são apenas posições ideológicas. Deveriam estudar um pouco mais e saber que as medidas tomadas pelo Presidente do STF  estão perfeitamente dentro da lei e é uma prerrogativa dele garantida pela constituição.
Estudem a Constituição e o  povo também deveria ser instruir um pouco mais ao invés de ficar comendo pela mãos de um bando de corruptos no Governo;
“Compete ao Supremo Tribunal Federal, precipuamente, a guarda da Constituição, cabendo-lhe:
I – processar e julgar, originariamente:
(…)
b) nas infrações penais comuns, o Presidente da República, o Vice-Presidente, os membros do Congresso Nacional, seus próprios Ministros e o Procurador-Geral da República;

Art. 123. A autorização será concedida por ato motivado do Juiz da execução, ouvidos o Ministério Público e a administração penitenciária e dependerá da satisfação dos seguintes requisitos:

I - comportamento adequado;

II - cumprimento mínimo de 1/6 (um sexto) da pena, se o condenado for primário, e 1/4 (um quarto), se reincidente;

III - compatibilidade do benefício com os objetivos da pena.
